class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function missingInteger($nums) {
        $sum = $nums[0]; // Initialize sum with the first element
        for ($i = 1; $i < count($nums); $i++) {
            // Check if the current element continues the sequence from the previous one
            if ($nums[$i] == $nums[$i - 1] + 1) {
                $sum += $nums[$i]; // Add to sum
            } else {
                break; // Break the loop if the sequence is broken
            }
        }
        // Find the smallest missing integer greater than or equal to the sum
        while (true) {
            if (!in_array($sum, $nums)) {
                return $sum; // Return the missing integer if it's not found in the array
            }
            $sum++; // Increment the sum to find the next potential missing integer
        }
    }
}
